import styled from "styled-components";

const UserItemArea = styled.li`
    border: 1px solid #ccc;
    margin: 0.5rem 0;
    padding: 0.5rem;
`

const UserItem = (props) => {
    return (
        <UserItemArea>{props.name} ({props.age} years old)</UserItemArea>
    )
} 

export default UserItem;
